import styles from './MainPage.module.css';
import { SearchBar } from '../SearchBar/SearchBar';
import VideoCard from "../VideoCard/VideoCard";
import array from "../utils";
export const MainPage = () => {
  const videos = array.slice().map((video) =>
    <VideoCard id={video.id} title={video.title} preview={video.preview}/>
  )


  return (
  <div>
    <SearchBar/>
     <div className={styles.videos_container}>
       { videos }
     </div>
    <ul className={styles.videos_container}>
      <li className={styles.video_preview_container}>
        <div className={styles.video_preview}></div>
        <p className={styles.title_video}>Название</p>
      </li>
    </ul>
  </div>
  )
}
